import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAlignCenter, faCoffee, faDisplay, faPerson } from '@fortawesome/free-solid-svg-icons';
import logo from '../../logo.svg';
import './Home.css';

function Home() {
  return (
    <>
      <header>
        <div className='header'>
          <div className='header-logo'>
            <h2>Project Vault</h2>
          </div>
          <div className='header-nav-elements'>
            <a href="#">
              <div>Home</div>
            </a>
            <a href="#">
              <div>Home</div>
            </a>
            <a href="#">
              <div>Home</div>
            </a>
            <a href="#">
              <div>
                <FontAwesomeIcon icon={f} className='icon' />
              </div>
            </a>
          </div>
        </div>
      </header>
      <h1>Hello, you're Home</h1>
    </>
  );
}

export default Home;
